import { Container } from "./styles";
import incomes from "../../assets/incomes.svg";

export function Summary() {
    return(
        <Container>
            <div>
                <header>
                    <p>Entradas</p>
                    <img src="incomes" alt="Entradas" />
                </header>
                <strong>R$ 1.000,00</strong>
            </div>
        </Container>
    );
}
